var CalcCraftSettingsTab = class extends import_obsidian.PluginSettingTab {
  constructor(app, plugin) {
    super(app, plugin);
  }
  display() {
    const { containerEl } = this;
    containerEl.empty();
    new import_obsidian.Setting(containerEl).setName("how many decimals").setDesc("use `-1` for default").addText(
      (text) => text.setPlaceholder("-1").setValue(this.plugin.settings.precision).onChange(async (value) => {
        this.plugin.settings.precision = value;
        await this.plugin.saveSettings();
        this.reloadPages();
      })
    );
    new import_obsidian.Setting(containerEl).setName("show labels").setDesc("show labels.").addToggle(
      (toggle) => toggle.setValue(this.plugin.settings.showLabels).onChange(async (value) => {
        this.plugin.settings.showLabels = value;
        await this.plugin.saveSettings();
        this.reloadPages();
      })
    );
    new import_obsidian.Setting(containerEl).setName("show formula cell borders").setDesc("show borders.").addToggle(
      (toggle) => toggle.setValue(this.plugin.settings.showBorders).onChange(async (value) => {
        this.plugin.settings.showBorders = value;
        await this.plugin.saveSettings();
        this.reloadPages();
      })
    );
    const themes = ["light", "dark"];
    themes.forEach((theme) => {
      this.containerEl.createEl("h5", {
        text: `${theme} theme colors`
      });
      this.createColorpicker_fg_bg(
        containerEl,
        "formula's cells color",
        "always shown",
        `formula_font_color_${theme}`,
        `formula_background_color_${theme}`
      );
      this.createColorpicker_fg_bg(
        containerEl,
        "error cell color",
        "if cell is not computable",
        `formula_font_error_${theme}`,
        `formula_background_error_${theme}`
      );
      this.createColorpicker_fg_bg(
        containerEl,
        "parents cell color",
        "When you hover over a cell, highlight the cells upon which this cell depends.",
        `formula_font_parents_${theme}`,
        `formula_background_parents_${theme}`
      );
      this.createColorpicker_fg_bg(
        containerEl,
        "children cell color",
        "When you hover over a cell, highlight the cells that depend on this cell.",
        `formula_font_children_${theme}`,
        `formula_background_children_${theme}`
      );
      this.createColorpicker_fg_bg(
        containerEl,
        "matrix cell color",
        "[light theme]",
        `formula_font_matrix_${theme}`,
        `formula_background_matrix_${theme}`
      );
    });
    const div2 = containerEl.createEl("div", {
      cls: "advanced-tables-donation"
    });
    const donateText = document.createElement("p");
    donateText.appendText(
      "If this plugin adds value for you and you would like to help support continued development, please use the buttons below:"
    );
    div2.appendChild(donateText);
    const parser2 = new DOMParser();
    div2.appendChild(
      createDonateButton(
        "https://www.paypal.com/paypalme/klaudyu",
        parser2.parseFromString(paypal, "text/xml").documentElement
      )
    );
    div2.appendChild(
      createDonateButton(
        "https://www.buymeacoffee.com/klaudyul",
        parser2.parseFromString(buyMeACoffee, "text/xml").documentElement
      )
    );
    div2.appendChild(
      createDonateButton(
        "https://revolut.me/klaudyu",
        parser2.parseFromString(revolut, "text/xml").documentElement
      )
    );
  }
  reloadPages() {
    this.app.workspace.getLeavesOfType("markdown").forEach((e3) => e3.rebuildView());
  }
  createColorpicker_fg_bg(containerEl, name309, description, colorfg, colorbg) {
    const sett = new import_obsidian.Setting(containerEl).setName(name309).setDesc(description);
    const togglename = colorbg.substring(
      0,
      colorbg.lastIndexOf("_") === -1 ? colorbg.length : colorbg.lastIndexOf("_")
    ) + "_toggle";
    sett.addToggle(
      (toggle) => toggle.setValue(this.plugin.settings[togglename]).onChange(async (value) => {
        this.plugin.settings[togglename] = value;
        await this.plugin.saveSettings();
        this.display();
        this.reloadPages();
      })
    );
    if (this.plugin.settings[togglename]) {
      this.createColorPicker(sett, "font color:", colorfg);
      this.createColorPicker(sett, "background color:", colorbg);
    }
  }
  createColorPicker(setting, text, variable) {
    this.plugin.cssVariables.push(variable);
    const color_picker = createEl(
      "input",
      {
        type: "color",
        cls: "settings-color-picker"
      },
      (el) => {
        el.value = this.plugin.settings[variable];
        el.onchange = () => {
          this.plugin.settings[variable] = el.value;
          this.plugin.saveSettings();
          document.documentElement.style.setProperty(
            "--CalcCraft_" + variable,
            this.plugin.settings[variable]
          );
        };
      }
    );
    setting.controlEl.appendChild(createEl("span", { text }));
    setting.controlEl.appendChild(color_picker);
  }
};
